import React from "react";
import Scouting from './Scouting';
import './carousselScouting.css'
import Arrow from '../../img/Arrow.png'

const CarouselScouting = () => {
  return (
    <div id="caroussel">
        <svg xmlns="http://www.w3.org/2000/svg" width="75" viewBox="0 0 579.12 579.12" id="leftArrow">
            <g id="Composant_2_1" data-name="Composant 2 – 1" transform="translate(289.56) rotate(45)">
                <rect id="Rectangle_1" data-name="Rectangle 1" width="409" height="64" fill="#202b43"/>
                <g id="Composant_1_1" data-name="Composant 1 – 1" transform="translate(345.5 0.5)">
                <rect id="Rectangle_2" data-name="Rectangle 2" width="409" height="64" transform="translate(0 409) rotate(-90)" fill="#202b43"/>
                </g>
            </g>
        </svg>
       <Scouting/>
    </div>
  );
}

export default CarouselScouting;
